// SPDX-License-Identifier: MIT
pragma solidity ^0.8.20;

import "@openzeppelin/contracts/security/ReentrancyGuard.sol";

/// @title ElitePay Payment Smart Contract (Core V1)
/// @notice Stores user balance by UID + allows merchant payments
contract PaymentProcessor is ReentrancyGuard {

    address public owner;
    address public merchant;

    mapping(uint256 => uint256) public balances;

    event TopUp(uint256 indexed uid, uint256 amount);
    event PaymentProcessed(uint256 indexed uid, uint256 amount);
    event Withdrawal(uint256 amount);

    constructor(address _merchant) {
        require(_merchant != address(0), "Merchant cannot be zero");
        owner = msg.sender;
        merchant = _merchant;
    }

    function topUp(uint256 uid) external payable {
        require(msg.value > 0, "Amount must be > 0");
        require(uid != 0, "UID cannot be zero");

        balances[uid] += msg.value;
        emit TopUp(uid, msg.value);
    }

    function pay(uint256 uid, uint256 amount) external nonReentrant {
        require(balances[uid] >= amount, "Insufficient balance");
        require(merchant != address(0), "Invalid merchant");

        balances[uid] -= amount;

        (bool success, ) = payable(merchant).call{value: amount}("");
        require(success, "Transfer failed");

        emit PaymentProcessed(uid, amount);
    }

    function ownerWithdraw(uint256 amount) external nonReentrant {
        require(msg.sender == owner, "Not owner");
        require(amount <= address(this).balance, "Insufficient contract balance");

        (bool success, ) = payable(owner).call{value: amount}("");
        require(success, "Withdrawal failed");

        emit Withdrawal(amount);
    }

    receive() external payable {}
}

